description:
Ultimate Spider-man - Season 1 - Episodes 10 to 14
--------------------------------------------------

Peter Parker has been saving lives and fighting supervillains as Spider-Man
for about a year and is still learning the ropes on being a superhero.
Nick Fury of S.H.I.E.L.D. finds Peter and offers the young hero a chance
to be trained becoming the &quot;Ultimate Spider-Man&quot; while learning to work
with other teenage superheroes.

Produced by Marvel Animation and Film Roman.

